import React, { Component } from 'react';

import "./Card.css";
import wishLogo from "../Constant/wishlogo.png"


class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="card">

        <div className="card-content">
          <div className="card-projectNameContainer">
            {/* Insert Icon here */}
            <img src={wishLogo}/>
            <p className="card-projectName">
              {this.props.projectName}
            </p>
          </div>

          <p className="card-intro">
            {this.props.intro}
          </p>

          <div className="btn-container">
            <button className="main-btn">Detail</button>
            <button className="grey-btn">Download</button>
          </div>
        </div>
        <img src="https://source.unsplash.com/random" />

      </div>
    );
  }
}

export default Card;
